('UCWv7vMbMWH4-V0ZXdmDpPBA', 'Programming with Mosh', 'Hi! I\'m Mosh üëã, a software engineer with over 20 years of experience.  I\'m all about clear, concise, practical coding tutorials ‚Äì no fluff, just the good stuff! My courses focus on real-world projects and the skills that will get you hired. I\'ve helped millions of students transform their careers. \n\nWant to level up your skills? Subscribe and hit the bell to get notified when I upload new videos!\n', 'https://yt3.ggpht.com/lCeCb47hCbXWFa0I4gi8uWDHzWSs7sjK4FDmk7lFEUMRNp6QRzIQOkwaKhwv7eNKZacRI2uR=s88-c-k-c0x00ffffff-no-rj'),
('UC_x5XG1OV2P6uZZ5FSM9Ttw', 'Google for Developers', 'Subscribe to join a community of creative developers and learn the latest in Google technology ‚Äî from AI and cloud, to mobile and web.\n\nExplore more at developers.google.com\n\n', 'https://yt3.ggpht.com/PrZwRLLSaiXr5t-GRUhUFch2Qlol1G_voyuo-jJ4y-mqcVza7o7j_24yGRiydUP7UsQiKwo7=s88-c-k-c0x00ffffff-no-rj');
