('-3S36NPWuQY', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'Tips & tricks for using IDX: Building with Gemini in IDX', 'Learn how to use some of Project IDX‚Äôs built-in AI-assistance features to help speed up and refine your end-to-end developer workflow, all backed by Gemini, Google‚Äôs latest and most capable AI model. \n\nChapters: \n0:00 - Intro \n0:30 - Inline AI assistance Demo\n1:31 - How to modify existing code with AI \n\nResources: \nRead about more IDX‚Äôs AI features here ‚Üíhttps://goo.gle/3X5z2vg\nStart building with Project IDX today ‚Üí https://goo.gle/4c1uxFU \n\nSubscribe to Google for Developers ‚Üí https://goo.gle/developers\n\nSpeaker: David East\n\n#ProjectIDX', 'https://i.ytimg.com/vi/-3S36NPWuQY/default.jpg', 'https://www.youtube.com/watch?v=-3S36NPWuQY', NULL),
