('-NgqTMLRhKU', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'üí°üîß Gemini API and Gemma just got some awesome updates!', 'Build with a 2M context window, now available to all developers via Gemini 1.5 Pro, optimize long context window costs with context caching, check out code execution to build advanced code-based use cases, and explore the newly launched Gemma 2, now accessible in Google AI Studio. \n\nWhat‚Äôs your favorite update? üëÄ\n\nSubscribe to Google for Developers for more Gemini API content ‚Üí https://goo.gle/developers', 'https://i.ytimg.com/vi/-NgqTMLRhKU/default.jpg', 'https://www.youtube.com/watch?v=-NgqTMLRhKU', NULL),
('-Veo9L5j0qg', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'Angular v18 now available, Announcing Trillium, and more dev news!', 'TL;DR 392  | The Google Developer News Show\n\nChapters:\n0:00 - Intro \n0:09 - What‚Äôs new in Jetpack Compose I/O 2024 ‚Üí https://goo.gle/4dVXbu1  \n0:48 - Angular v18 is now available ‚Üí https://goo.gle/3QZs1Z2 \n1:23 - Announcing Trillium, the sixth generation of Google Cloud TPU ‚Üí https://goo.gle/3Kklkgh \n\nHere to bring you the latest developer news from across Google is Meghan Mehta covering announcements from Google I/O. Tune in every week for a new episode, and let us know what you think of the latest announcements in the comments below.\n\nFollow Google for Developers on Instagram ‚Üí https://goo.gle/googledevs \n\nWatch more #DevShow ‚Üí https://goo.gle/GDevShow\n Subscribe to Google for Developers ‚Üí https://goo.gle/developers  \n\n#Google #Developers\n\nSpeaker: Dan Galpin', 'https://i.ytimg.com/vi/-Veo9L5j0qg/default.jpg', 'https://www.youtube.com/watch?v=-Veo9L5j0qg', NULL),
('-_X6PhkjpzU', 'UCWv7vMbMWH4-V0ZXdmDpPBA', '5 Front-end Development Skills to Land Your First Job', 'Everything you need to know in a simple path to get hired fast. This video is the second part of my Web Development series. In the first part, we covered 5 facts about web development. \n\nhttps://www.youtube.com/watch?v=Nb0btdq1164\n\nIn this part, we talk about the 5 essential front-end development skills you need to get your first front-end development job. \n\nHere are some learning resources for you: \n- HTML/CSS: https://youtu.be/qz0aGYrrlhU\n- JavaScript: https://youtu.be/W6NZfCO5SIk\n- React: https://youtu.be/Ke90Tje7VS0\n- TypeScript: https://youtu.be/NjN00cM18Z4\n- Git: https://youtu.be/8JJ101D3knE\n\nFundamental front-end development skills: https://bit.ly/2JJeeWW\n\n\n‚≠êÔ∏è Want to learn more from me? Check out these links: \n\nCourses: https://codewithmosh.com\nTwitter: https://twitter.com/moshhamedani\nFacebook: https://www.facebook.com/programmingwithmosh/\nBlog: https://programmingwithmosh.com', 'https://i.ytimg.com/vi/-_X6PhkjpzU/default.jpg', 'https://www.youtube.com/watch?v=-_X6PhkjpzU', NULL),
('0-S5a0eXPoc', 'UCWv7vMbMWH4-V0ZXdmDpPBA', 'React Native Tutorial for Beginners - Build a React Native App', 'Build amazing iOS & Android apps with React Native! üöÄ This beginner-friendly tutorial gets you started.\n\nüöÄ Ready for a deep dive? \n- Check out my full course: https://mosh.link/react-native-course\n- Subscribe for more awesome content: https://goo.gl/6PYaGF\n\n‚úã Stay connected:\n- Twitter: https://twitter.com/moshhamedani\n- Facebook: https://www.facebook.com/programmingwithmosh/\n- Instagram: https://www.instagram.com/codewithmosh.official/\n- LinkedIn: https://www.linkedin.com/school/codewithmosh/\n\nüí° Why React Native?\n- Build apps for both iOS & Android using your web development skills.\n- Faster development than native languages.\n- Huge developer community and resources.\n\nüëâ This tutorial is perfect for you if:\n- You know basic React.\n- Want to break into mobile app development.\n- You value fast development and cross-platform compatibility.\n\nüìï Learn React\n- React Tutorial for Beginners: https://youtu.be/Ke90Tje7VS0\n- Mastering React Course: http://bit.ly/2KVl2A3\n\nüéÅ Get the FREE goodies:\n- Layout Exercises PDF: https://bit.ly/3dzbKDZ\n- Layout Exercises Supplementary Materials: https://bit.ly/3fvqZQ9\n\nüìñ TABLE OF CONTENT \n0:00:00 Introduction\n0:02:20 Prerequisites\n0:02:58 What is React Native?\n0:04:33 Expo\n0:06:19 Setting up the development environment \n0:09:17 Your First React Native App\n0:14:38 Running on an iOS simulator\n0:18:02 Running on an Android emulator\n0:26:48 Running on a physical device\n0:27:54 Logging\n0:29:16 Debugging with Chrome\n0:34:27 Debugging in VSCode\n0:41:39 Publishing\n0:46:30 Fundamental Concepts\n0:48:20 View\n0:51:08 Text\n0:53:50 Image\n0:59:25 Touchables\n1:04:21 Button\n1:06:01 Alert\n1:09:55 StyleSheet\n1:14:49 Platform-specific code\n1:18:06 Layouts\n1:18:43 Dimensions\n1:22:22 Detecting orientation changes\n1:27:39 Flexbox\n1:30:56 flexDirection\n1:32:48 justifyContent,