('0cqS8J8XbZk', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'Determine the structures and values of this merged array. Go!', 'Attention PHP enthusiasts! Our latest developer challenge will test your array merging skills and knowledge. Can you predict the output of merging arrays with numeric and string keys? Watch the video, share your solution, and join the discussion!\n\n\nSubscribe to Google for Developers ‚Üí https://goo.gle/developers', 'https://i.ytimg.com/vi/0cqS8J8XbZk/default.jpg', 'https://www.youtube.com/watch?v=0cqS8J8XbZk', NULL),
('11JuMc2sITA', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'What\'s in your Google Wallet?', 'Google Wallet will soon be available in all major countries and territories. Don‚Äôt miss this chance to learn how to create event tickets, loyalty cards, gift cards, and more with the Google Wallet API. Join us live and ask questions in realtime! \nThursday, June 6th 9am PST. \n\nSubscribe to Google for Developers ‚Üí https://goo.gle/developers  \n\n#GoogleWallet #developer', 'https://i.ytimg.com/vi/11JuMc2sITA/default.jpg', 'https://www.youtube.com/watch?v=11JuMc2sITA', NULL),
('1GlJnq-24uU', 'UCWv7vMbMWH4-V0ZXdmDpPBA', 'Mosh\'s Christmas Gift to You!', 'Sign up today to redeem this offer: https://codewithmosh.com/p/all-access', 'https://i.ytimg.com/vi/1GlJnq-24uU/default.jpg', 'https://www.youtube.com/watch?v=1GlJnq-24uU', NULL),
('1mD7-WWKvto', 'UCWv7vMbMWH4-V0ZXdmDpPBA', 'Level Up Your VSCode Game: 5 Must-know Shortcuts', 'Let\'s make your VSCode experience smoother and faster.  Here are 5 shortcuts I use all the time, and you should too!\n\n‚úã Stay connected\n\n- Twitter: https://twitter.com/moshhamedani\n- Facebook: https://www.facebook.com/programmingwithmosh/\n- Instagram: https://www.instagram.com/codewithmosh.official/\n- LinkedIn: https://www.linkedin.com/school/codewithmosh/\n\n#vscode #coding #programming', 'https://i.ytimg.com/vi/1mD7-WWKvto/default.jpg', 'https://www.youtube.com/watch?v=1mD7-WWKvto', NULL),
('1WECqGmT6Hc', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'Best practices for designing generative AI products that are safe, trustworthy, and helpful', 'Generative AI models have unlocked new capabilities, but they\'ve also introduced new challenges. In this session, get practical guidance to help user experience, product, engineering, and AI teams build responsible generative AI products. Learn about data, design, and AI development best practices from the recently updated People + AI Guidebook, spanning the full product lifecycle. Start your journey toward creating people-centered AI systems.\n\nLearn more about Vertex AI ‚Üí https://goo.gle/3Kwbvfi \nThe People + AI Guidebook ‚Üí  https://goo.gle/3UyhlCR\nResponsible Generative AI Toolkit ‚Üí https://goo.gle/3WdxoHl\nInteraction Design Policies ‚Üí https://goo.gle/3JvSSrm\n\nSpeakers: Mahima Pushkarna, Sally Limb\n\nWatch more:\nCheck out all the AI videos at Google I/O 2024 ‚Üí https://goo.gle/io24-ai-yt\n\n\nSubscribe to Google Developers ‚Üí https://goo.gle/developers\n\n#GoogleIO  \n\nEvent: Google I/O 2024', 'https://i.ytimg.com/vi/1WECqGmT6Hc/default.jpg', 'https://www.youtube.com/watch?v=1WECqGmT6Hc', NULL),
('1Wehg6Bzrn8', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'Generative AI on-device at Google I/O 2024', 'Learn about Generative AI on-device. At Google I/O 2024, the GenAI on-device demonstrated the Gemma 2B model running on a Pixel, Samsung, and iPhone, and Gemma 7B model running on Chromebook all running fully offline. \n\nLearn more on how to run Gemma and other popular OSS models on device ‚Üí https://goo.gle/llm-inference-guide \n\n#GoogleIO #AI \n\nSubscribe to Google for Developers ‚Üí https://goo.gle/developers \n\nProducts Mentioned: Gemma', 'https://i.ytimg.com/vi/1Wehg6Bzrn8/default.jpg', 'https://www.youtube.com/watch?v=1Wehg6Bzrn8', NULL),
('27YP6n6pDh0', 'UCWv7vMbMWH4-V0ZXdmDpPBA', 'The FASTEST Way to Learn to Code & Get a Job', 'Ready to change your life? Learn how ordinary people transformed their careers with coding and landed high-paying tech jobs in a year. Step-by-step system inside!\n\n‚úã Stay connected\n\n- Twitter: https://twitter.com/moshhamedani\n- Facebook: https://www.facebook.com/programmingwithmosh/\n- Instagram: https://www.instagram.com/codewithmosh.official/\n- LinkedIn: https://www.linkedin.com/school/codewithmosh/\n\nüìñ Chapters\n\n00:05 - Meet people who transformed their lives with code\n00:59 - The coding trap that\'s slowing you down\n01:28 - Your dream tech job: how to choose\n01:44 - The roadmap to your coding success\n02:07 - The right way to learn coding\n02:52 - How to practice\n03:37 - How to impress employers\n03:56 - How to prepare for interviews\n05:00 - Your job search action plan\n\n#codingjourney #learntocode #leetcode  #programming #coding #techinsider', 'https://i.ytimg.com/vi/27YP6n6pDh0/default.jpg', 'https://www.youtube.com/watch?v=27YP6n6pDh0', NULL),
('2AJ_czahQDY', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'What will be the output on this Go program? Go!', 'Calling all Go developers! Put your goroutine and synchronization skills to the test. Check out our latest coding challenge and predict the output. What order will the messages be printed in? Share your thoughts in the comments below.\n\nSubscribe to Google for Developers ‚Üí https://goo.gle/developers', 'https://i.ytimg.com/vi/2AJ_czahQDY/default.jpg', 'https://www.youtube.com/watch?v=2AJ_czahQDY', NULL),
('2ReR1YJrNOM', 'UCWv7vMbMWH4-V0ZXdmDpPBA', 'What is Git? Explained in 2 Minutes!', 'This short video explains what Git is and why it\'s a critical skill for every software & DevOps engineer. \nüëç Subscribe for more Git tutorials like this: https://goo.gl/6PYaGF\nüëâ Learn Git basics in one hour: https://youtu.be/8JJ101D3knE\n\n#Git is the most popular open-source version control system in the world. Everyday, millions of people use Git to track their project history and collaborate effectively. It\'s a critical skill for a every software and DevOps engineer. \n\n‚≠êÔ∏è Want to learn more from me? Check out these links: \n\nCourses: https://codewithmosh.com\nTwitter: https://twitter.com/moshhamedani\nFacebook: https://www.facebook.com/programmingwithmosh/\nBlog: https://programmingwithmosh.com', 'https://i.ytimg.com/vi/2ReR1YJrNOM/default.jpg', 'https://www.youtube.com/watch?v=2ReR1YJrNOM', NULL),
('3NePkYhFkiw', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'An introduction to MediaPipe‚Äôs Face Landmarker & how it can power hands free gaming', 'Paul and Lance dive deep into Face Landmarker, the underlying MediaPipe task that\'s used for Project Gameface and dissect the code piece by piece. Paul explains how the model works to interpret extraneous movements that you can make with your face and how it protects user privacy. Learn how you can use the model to power your own creations.\n\nProject Gameface is an open-source hands-free gaming project powered by AI that allows users to control a computer using their head movement and facial gestures. For more info, check out the first episode. \n\nResources:\nLearn more about Project Gameface ‚Üí https://goo.gle/3wCCaDR \nWatch episode 1 ‚Üí https://goo.gle/3WGc5yd \nWatch episode 2 ‚Üí https://goo.gle/4b77mtX \nWatch episode 3 ‚Üí https://goo.gle/3UXswVA \n\nChapters:\n0:00 - Introduction\n0:50 - Last episode recap\n2:07 - What is tessellation\n4:14 - Face landmarkers\n6:46 - Creating the detector\n7:33  - Detection results\n8:37 - What is the lag?\n9:01 - Highlighting the irises\n9:26 - How the model is open to any face\n10:38 - Open for anyone to use\n\nSubscribe to the TensorFlow channel ‚Üí https://goo.gle/TensorFlow \n\n#MediaPipe #Accessibility #Gaming\n\nSpeaker: Paul Ruiz', 'https://i.ytimg.com/vi/3NePkYhFkiw/default.jpg', 'https://www.youtube.com/watch?v=3NePkYhFkiw', NULL),
('3WphgC4wq0I', 'UCWv7vMbMWH4-V0ZXdmDpPBA', 'Stop Wasting Time on the Wrong Languages', '#coding #programming', 'https://i.ytimg.com/vi/3WphgC4wq0I/default.jpg', 'https://www.youtube.com/watch?v=3WphgC4wq0I', NULL),
('3ZEMvvDFEdA', 'UCWv7vMbMWH4-V0ZXdmDpPBA', 'Become a Mobile Developer in 12 Months! üöÄ', '#mobileappdevelopment  #webdevelopment  #coding #codewithmosh', 'https://i.ytimg.com/vi/3ZEMvvDFEdA/default.jpg', 'https://www.youtube.com/watch?v=3ZEMvvDFEdA', NULL),
('4gX44uyGSHo', 'UCWv7vMbMWH4-V0ZXdmDpPBA', 'Is Coding Still Worth Learning in 2024?', 'AI replacing coders? The REAL story about software engineering in 2024. Stats, trends, and the truth you need to know.\n\n‚úã Stay connected\n\n- Twitter: https://twitter.com/moshhamedani\n- Facebook: https://www.facebook.com/programmingwithmosh/\n- Instagram: https://www.instagram.com/codewithmosh.official/\n- LinkedIn: https://www.linkedin.com/school/codewithmosh/\n\nüìñ Chapters\n\n00:00 - Is coding still worth learning in 2024?\n01:16 - Is AI replacing software engineers?\n02:12 - Impact of AI on software engineering\n03:31 - The problem with AI-generated code \n05:15 - How AI can help software engineers \n05:53 - Does AI really make you code faster?\n07:05 - Can one AI-powered engineer do the work of many?\n08:07 - Future of software engineering \n\n#coding #techinsider #ai', 'https://i.ytimg.com/vi/4gX44uyGSHo/default.jpg', 'https://www.youtube.com/watch?v=4gX44uyGSHo', NULL),
('4IErbubZjTE', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'Google AI Studio at Google Cloud Next ‚Äò24', 'Joana, Head of Community on the Developer Relations team, shares why she‚Äôs most excited for the Google AI Studio at Google Cloud Next 2024. Google AI studio allows developers to prototype apps to see whether or not it\'s feasible and to get it done quickly. She also shares updates for frameworks with Jax, Keras, and Gemma open models. \n\nFor more information visit ‚Üí https://goo.gle/AI-Studio \n\n#GoogleAI #GoogleCloudNext\n\nSpeaker: Joana Carrasqueira\nProducts Mentioned: Google AI Studio', 'https://i.ytimg.com/vi/4IErbubZjTE/default.jpg', 'https://www.youtube.com/watch?v=4IErbubZjTE', NULL),
('4niepTetuUo', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'Gemini API Developer Competition - How to Join', 'Check out the video for our best tips to enter the Gemini API Developer Competition. Winners get cash prizes, cool swag, the #1 app gets a real-life, electric-powered DeLorean! You in? We want a video demo submission under three minutes that showcases your Gemini API-powered app. Good luck, we can‚Äôt wait to see what you build! \n\nChapters: \n0:00 - Intro \n0:14 - Overview of the Gemini API Developer Competition\n0:32  - Learn Gemini with this playlist ‚Üí https://goo.gle/buildwithgemini  \n1:01 - How to submit your app\n1:11 - Video submission guidelines \n1:20- Tips for your video submission\n2:11 - Where to submit your video \n\n\nResources:\nLearn Gemini ‚Üí https://goo.gle/buildwithgemini \nEnter the competition and see more details ‚Üí https://goo.gle/4b64PQG \nConnect with other Gemini API developers on Discord ‚Üí https://bit.ly/4eqCUgv\nConnect with other Gemini API developers on the Forum ‚Üí https://goo.gle/4aH6k6V \n\nSubscribe to Google for Developers for more Gemini API content ‚Üí https://goo.gle/developers\n\n#Gemini #competition #BuildwithGemini\n\nProducts Mentioned: Gemini\nEvent: Google I/O 2024', 'https://i.ytimg.com/vi/4niepTetuUo/default.jpg', 'https://www.youtube.com/watch?v=4niepTetuUo', NULL),
('55T3HLuFLR0', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'Introducing Project Gameface for Android', 'Last year we launched Project Gameface for PC, now we\'re making it available for Android! Get the open-source code at https://goo.gle/project-gameface\n\n\nEvent: Google I/O 2024', 'https://i.ytimg.com/vi/55T3HLuFLR0/default.jpg', 'https://www.youtube.com/watch?v=55T3HLuFLR0', NULL),
('57W6vJNyb6A', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'Developer Keynote (Google I/O \'24) - Audio Described', 'Learn about the latest updates to our developer products and platforms.\n\nTo watch this keynote without audio descriptions, please click here:\nhttps://youtube.com/live/ddcZnW1HKUY\n\nTo watch this keynote with American Sign Language (ASL) interpretation, please click here: \nhttps://youtube.com/live/cQWQM19zQfs\n\n00:00 Introduction\n04:39 AI APIs\n13:45 Mobile\n31:22 Web\n41:26 Cross-platform\n50:37 AI Models\n01:01:02 Closing\n\n#GoogleIO\n\nGoogle I/O 2024', 'https://i.ytimg.com/vi/57W6vJNyb6A/default.jpg', 'https://www.youtube.com/watch?v=57W6vJNyb6A', NULL),
('6oFuwhIibo4', 'UCWv7vMbMWH4-V0ZXdmDpPBA', 'What Is React Native & Why Is It So Popular?', 'What is React Native? This short video explains it in 5 minutes. \nüöÄ React Native tutorial for beginners: https://youtu.be/0-S5a0eXPoc\nüëç Subscribe for more React Native tutorials like this: https://goo.gl/6PYaGF\n\nWant to learn more from me? Check out my blog and courses: \n\nCourses: https://codewithmosh.com\nBlog: https://programmingwithmosh.com \nFacebook: https://www.facebook.com/programmingwithmosh\nTwitter: https://twitter.com/moshhamedani\n\nReact Native is a framework for building cross-platform mobile apps for iOS and Android. A lot of companies prefer to use React Native these days as it cuts down the development and production time significantly. With React Native, you can build native apps for iOS and Android using a single code base written in JavaScript. So, if you know JavaScript and React, you can use React Native to build native mobile apps today. This video gives you a brief introduction to React Native and then compares React Native with Flutter and Xamarin.', 'https://i.ytimg.com/vi/6oFuwhIibo4/default.jpg', 'https://www.youtube.com/watch?v=6oFuwhIibo4', NULL),
