('Bel4pWqA4PE', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'An LLM journey speed run: Going from Hugging Face to Vertex AI', 'Discover how to augment a Vertex Gemini based gen AI application with predictive open source models. We will share how to deploy Google\'s open source TimesFM forecasting foundation model from Hugging Face via the Vertex Model Garden, then integrate it with a generative AI solution, such as our Retail Product Catalog agent, via Vertex Gemini\'s function calling capabilities.\n\nSpeakers: Skander Hannachi, Rajesh Thallam\n\nResources: \nTry Gemini in Vertex AI ‚Üí https://goo.gle/3Vttolh \n\nWatch more:\nCheck out all the AI videos at Google I/O 2024 ‚Üí https://goo.gle/io24-ai-yt\nCheck out all the Cloud videos at Google I/O 2024 ‚Üí https://goo.gle/io24-cloud-yt\n\nSubscribe to Google Developers ‚Üí https://goo.gle/developers\n\n#GoogleIO  \n\nEvent: Google I/O 2024', 'https://i.ytimg.com/vi/Bel4pWqA4PE/default.jpg', 'https://www.youtube.com/watch?v=Bel4pWqA4PE', NULL),
