('brV8mrBkswA', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', '2024 Solution Challenge Demo Day', 'Join us for the 2024 Solution Challenge Demo Day hosted by Google Developer Student Clubs. The Final 10 teams will demo their solutions live while judges select the Winning 3 teams! With months in the making, these students have come together with their local Google Developer Student Club teammates at their universities to create some truly inspiring ideas to support the United Nations 17 Sustainable Development Goals. \n\nChapters: \n0:00 - Livestream countdown \n2:37 - Welcome to Demo Day 2024 \n7:45 - Project demo: ATTI \n15:44 - Project demo: DONUT\n22:30 - Project demo: Glutara\n30:19 - Project demo: BYTE\n38:37 - Project demo: Saheli \n46:10 - Project demo: Spoon Share \n54:36 - Project demo: Nicless\n1:04:06 - Project demo: ExoHeal \n1:08:17 - Project demo: Alpha-Eye \n1:19:09 - Project demo: Therapute \n1:26:16 - Tips from the finalists \n1:28:15 - Top 3 winners \n1:30:53 - Peoples Choice Award \n1:31:28 - Closing statements \n\nResources: \nJoin a Google Developer Student Club‚Üí https://goo.gle/GDSC\n\nSubscribe to Google for Developers ‚Üí https://goo.gle/developers', 'https://i.ytimg.com/vi/brV8mrBkswA/default.jpg', 'https://www.youtube.com/watch?v=brV8mrBkswA', NULL),
