('HG6yIjZapSA', 'UCWv7vMbMWH4-V0ZXdmDpPBA', 'Docker Compose Tutorial', 'Learn all about Docker Compose so you can orchestrate your services with confidence! \n- Get the complete Docker course (zero to hero): https://bit.ly/3sO7Z5H\n- Subscribe for more Docker tutorials like this: https://goo.gl/6PYaGF\n\n‚≠êÔ∏è Want to learn more from me? Check out these links:\n\nCourses: https://codewithmosh.com\nTwitter: https://twitter.com/moshhamedani\nFacebook: https://www.facebook.com/programmingwithmosh/\nBlog: http://programmingwithmosh.com \n\n#Docker #DevOps\n\nDocker is the de facto standard for building, shipping and running applications in a consistent manner. That\'s why most companies use it and are looking for developers with Docker skills. If you\'re looking for a career in software or DevOps engineering, you must have Docker on your resume. And not only that, you should know it well and be able to use it to effectively package and deploy your applications.', 'https://i.ytimg.com/vi/HG6yIjZapSA/default.jpg', 'https://www.youtube.com/watch?v=HG6yIjZapSA', NULL),
