('laqu7NqSlLo', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'A new renaissance in art: Refik Anadol on the AI transformation of art', 'Dialogues on Technology and Society\n\nLearn from internationally renowned media artist, Refik Anadol, who is pioneering the intersection of AI and art, and how he‚Äôs unlocking new forms of creativity.\n\nTo watch and learn more, check out https://yt.be/dialogues\n\nSpeakers: Refik Anadol, Media Artist & Director, Refik Anadol Studio \nMira Lane, Senior Director, Technology & Society, Google\n\nWatch more:\nCheck out all the AI videos at Google I/O 2024 ‚Üí https://goo.gle/io24-ai-yt\n\nSubscribe to Google Developers ‚Üí https://goo.gle/developers\n\n#GoogleIO  \n\n\nEvent: Google I/O 2024', 'https://i.ytimg.com/vi/laqu7NqSlLo/default.jpg', 'https://www.youtube.com/watch?v=laqu7NqSlLo', NULL),
('LF7I6raAIL4', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'How to build Multimodal Retrieval-Augmented Generation (RAG) with Gemini', 'The saying \"\"a picture is worth a thousand words\"\" encapsulates the immense potential of visual data. But most retrieval-augmented generation (RAG) applications rely only on text. This session applies RAG to multimodal use cases. It focuses on embeddings and attributed question answering to retrieve data. We‚Äôll begin with a high-level architecture and quickly dive into a practical demo. Attendees will learn to create powerful LLM-based workflows and embed them in existing applications.\n\nSpeakers: Shilpa Kancharla, Jeff Nelson\n\nResources: \nTry Gemini in Vertex AI ‚Üí https://goo.gle/3Vttolh \n\nWatch more:\nCheck out all the AI videos at Google I/O 2024 ‚Üí https://goo.gle/io24-ai-yt\nCheck out all the Cloud videos at Google I/O 2024 ‚Üí https://goo.gle/io24-cloud-yt\n\nSubscribe to Google Developers ‚Üí https://goo.gle/developers\n\n#GoogleIO  \n\n\nEvent: Google I/O 2024', 'https://i.ytimg.com/vi/LF7I6raAIL4/default.jpg', 'https://www.youtube.com/watch?v=LF7I6raAIL4', NULL),
('lSq3h-_PTVY', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'The Gemini API: From prototype to production', 'Gemini empowers developers to streamline the creation of innovative applications. Learn how to harness Gemini\'s power for rapid prototyping and seamless scaling. Begin your journey in Google AI Studio, where Gemini facilitates faster experimentation and iteration. As your project matures, frictionlessly transition to Google Cloud\'s Vertex AI to integrate Gemini\'s advanced capabilities with production-ready services and tools, ensuring your application is robust, safe, secure and scalable.\n\nSpeakers: Lavi Nigam\n\nWatch more:\nCheck out all the AI videos at Google I/O 2024 ‚Üí https://goo.gle/io24-ai-yt\nCheck out all the Cloud videos at Google I/O 2024 ‚Üí https://goo.gle/io24-cloud-yt\nCheck out all the Mobile videos at Google I/O 2024 ‚Üí https://goo.gle/io24-mobile-yt\n\n\nSubscribe to Google Developers ‚Üí https://goo.gle/developers\n\n#GoogleIO  \n\nEvent: Google I/O 2024', 'https://i.ytimg.com/vi/lSq3h-_PTVY/default.jpg', 'https://www.youtube.com/watch?v=lSq3h-_PTVY', NULL),
('LxQe4TqDdAU', 'UCWv7vMbMWH4-V0ZXdmDpPBA', 'Mosh\'s Xmas Gift (2021)', 'Here\'s Mosh\'s gift to you for this Christmas! Click the link below to redeem your coupon: \n\nhttps://codewithmosh.com/p/all-access/', 'https://i.ytimg.com/vi/LxQe4TqDdAU/default.jpg', 'https://www.youtube.com/watch?v=LxQe4TqDdAU', NULL),
('MP4-TQIyBi8', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'Top AI developer news from Google IO 2024', 'Learn about the top artificial intelligence (AI) technologies from Google I/O 2024. Ashley Oldacre and Joe Fernandez from Google AI Developer Relations share the latest updates on building with AI technology, from coding and custom applications with Gemini API and Gemma, to assembling and training customized ML models with Keras and JAX. Get quick news about AI Studio, Vertex AI, Google AI Edge, Web AI, PaliGemma, and more!\n\nSessions covered:\nDeveloper Keynote -Google I/O 2024 ‚Üí https://goo.gle/3WLbWtv \nAI-assisted coding to elevate software development ‚Üí https://goo.gle/4bjkR9W \nGemini API: From Prototype to Production  ‚Üí https://goo.gle/3UNZdDB \nGemini and OSS in action: Connect Gen AI models to the outside world ‚Üí https://goo.gle/3Vf8I0p \nGenerative AI on mobile and web with Google AI Edge ‚Üí https://goo.gle/3V0DPwl \nWeb AI: New models, tools, and APIs for your next web app ‚Üí https://goo.gle/4axXKaI \nGemma models: Unveiling the latest advancements ‚Üí https://goo.gle/3QRh3ER \nLarge Language models with Keras ‚Üí https://goo.gle/3QSbHcu \nML Frameworks for the GenAI Era ‚Üí https://goo.gle/4dN9uJg \nPeople-centered AI ‚Äì Creating responsible generative AI products ‚Üí https://goo.gle/4aoQldA \n\nWant to dive deeper and learn more? Check out the AI at Google 2024 playlist to find all the sessions and workshops.\n\nSubscribe to Google for Developers ‚Üí https://goo.gle/developers\n\n#GoogleIO\n\nSpeakers: Ashley Oldacre, Joe Fernandez', 'https://i.ytimg.com/vi/MP4-TQIyBi8/default.jpg', 'https://www.youtube.com/watch?v=MP4-TQIyBi8', NULL),
('n1DKWn9TIM0', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'Using Gemini Pro Vision for multimodal use cases with text, images, and videos', 'What are the applications of multimodality with Gemini? This session will cover a variety of different multimodal use cases for text, images, and video, and provide some ideas on how to apply multimodality to practical business scenarios. You\'ll also gain experience with Gemini Pro Vision.\n\nTry Gemini in Vertex AI ‚Üí https://goo.gle/3Vttolh \n\nTo complete this workshop, you will need a laptop and a Google Cloud Project.\n\nWalk through an interactive notebook with multimodal use cases with Gemini ‚Üí https://goo.gle/4b98tbY\nLearn about multimodal prompts in the Gemini documentation ‚Üí https://goo.gle/4aNzaTV\nTry out multimodal capabilities in Gemini Pro Vision to create a retail recommendation system ‚Üí https://goo.gle/49PRc6I\n\nNOTE: Cloud Credits discussed in this session or workshop were for live audiences only \n\nSpeakers: Lavi Nigam, Katie Nguyen\n\nWatch more:\nCheck out all the AI videos at Google I/O 2024 ‚Üí https://goo.gle/io24-ai-yt\n\nSubscribe to Google Developers ‚Üí https://goo.gle/developers\n\n#GoogleIO  \n\nProducts Mentioned: Gemini\nEvent: Google I/O 2024', 'https://i.ytimg.com/vi/n1DKWn9TIM0/default.jpg', 'https://www.youtube.com/watch?v=n1DKWn9TIM0', NULL),
('Nb0btdq1164', 'UCWv7vMbMWH4-V0ZXdmDpPBA', 'Learn Web Development and Make $78,000/y', '5 Web Development facts you need to know: pros, cons, salary, degree and how to get started. \nüëç Subscribe for more videos like this: https://goo.gl/6PYaGF\n\nWant to become a web developer with an average salary of $78,000 a year? This video answers the frequently-asked questions about web development: \n\n- Pros and cons of web development \n- Do you need a college degree? \n- What programming languages and tools to learn \n- How long it takes to get job ready\n\n‚≠êÔ∏è Want to learn more from me? Check out these links: \n\nCourses: https://codewithmosh.com\nTwitter: https://twitter.com/moshhamedani\nFacebook: https://www.facebook.com/programmingwithmosh/\nBlog: https://programmingwithmosh.com', 'https://i.ytimg.com/vi/Nb0btdq1164/default.jpg', 'https://www.youtube.com/watch?v=Nb0btdq1164', NULL),
('NgcVi01gkz0', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'Purple links üò¢', 'Don\'t let those purple links get you down! Just a part of the technicolor coding journey. üü™üíª \n\nSubscribe to Google for Developers ‚Üí https://goo.gle/developers', 'https://i.ytimg.com/vi/NgcVi01gkz0/default.jpg', 'https://www.youtube.com/watch?v=NgcVi01gkz0', NULL),
('NJzlY_NgxDc', 'UCWv7vMbMWH4-V0ZXdmDpPBA', 'Don\'t Let Ignorant CEOs Ruin Your Future (Coding Advice You Need)', 'Is AI really a threat to the next generation of coders? NVIDIA\'s CEO thinks so.\n\nSpeaking at the World Government Summit in Dubai, Jensen Huang, NVIDIA CEO, boldly stated: \"Everybody in the world is now a programmer. This is the miracle of artificial intelligence.\" He believes learning to code may become obsolete as AI advances.\n\nMy take? Generative AI will NOT replace programmers. Anyone who\'s built real enterprise software understands the complexities involved. Asking tools like ChatGPT for code snippets isn\'t the same as architecting the software that runs our world.\n\nWhat are your thoughts? \n\n#coding #chatgpt #ai', 'https://i.ytimg.com/vi/NJzlY_NgxDc/default.jpg', 'https://www.youtube.com/watch?v=NJzlY_NgxDc', NULL),
('nKzEJWbkPbQ', 'UCWv7vMbMWH4-V0ZXdmDpPBA', 'Insertion Sort Algorithm Made Simple [Sorting Algorithms]', 'Learn to implement the Insertion Sort algorithm and ace your coding interview.\nüëçSubscribe for more data structure and algorithm tutorials like this: https://goo.gl/6PYaGF\nüöÄGet the full data structures and algorithms course: https://bit.ly/2YfL3zr\n\nCONNECT WITH ME\n\nMy Courses: http://codewithmosh.com\nMy Blog: http://programmingwithmosh.com\nMy Facebook: https://www.facebook.com/programmingwithmosh\nMy Twitter: https://twitter.com/moshhamedani\n\nData Structures and Algorithms is an essential topic taught to computer science and software engineering students to help them learn logical thinking and problem solving. That\'s why a lot of companies these days ask data structure and algorithm questions in their interviews. Sorting algorithms are particularly important. Even though you never have to implement a sorting algorithm in real life, studying and understanding these algorithms help you become better solving larger, more complex problems.', 'https://i.ytimg.com/vi/nKzEJWbkPbQ/default.jpg', 'https://www.youtube.com/watch?v=nKzEJWbkPbQ', NULL),
('nRLDHpUINDc', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'Day in the life of a Google Wallet Product Manager', 'Ever wondered what it\'s like to be a Product Manager at Google? Join us for an exclusive, behind-the-scenes look at a typical day in the life of a Google PM. From morning meetings to product strategy sessions, you\'ll get an insider\'s view of the exciting challenges and rewards of this role, and how we\'re working hard to make Google Wallet an even better digital wallet for you!\n\nüî¥ Live Q&A: Got questions? We‚Äôve got answers! Stay tuned till the end for a live Q&A session where we‚Äôll be answering your questions in real-time.\n\nüìÖ Set Your Reminder: Don‚Äôt miss out! Click the bell icon to get notified when we go live.\n\nüëç Like & Subscribe: If you enjoy the video, don\'t forget to give it a thumbs up and subscribe for more insights into the tech world!\n\n#GooglePM #DayInTheLife #TechCareers #ProductManagement #LiveQnA\r\n\r\nSubscribe to Google for Developers ‚Üí https://goo.gle/developers  \r\n\r\n#GoogleWallet #developer', 'https://i.ytimg.com/vi/nRLDHpUINDc/default.jpg', 'https://www.youtube.com/watch?v=nRLDHpUINDc', NULL),
('NU_1StN5Tkk', 'UCWv7vMbMWH4-V0ZXdmDpPBA', 'Design Patterns in Plain English | Mosh Hamedani', 'Design Patterns tutorial explained in simple words using real-world examples. \n\nüöÄ Ready to master design patterns?\n- Check out my full course: https://mosh.link/design-patterns-course\n- Subscribe for more awesome content: https://bit.ly/38ijYjn\n\n‚úã Stay connected:\n- Twitter: https://twitter.com/moshhamedani\n- Facebook: https://www.facebook.com/programmingwithmosh/\n- Instagram: https://www.instagram.com/codewithmosh.official/\n- LinkedIn: https://www.linkedin.com/school/codewithmosh/\n\nüîó Related videos:\nhttps://youtu.be/eIrMbAQSU34\n\nüìñ Chapters \n0:00:00 Introduction\n0:01:40 What are Design Patterns? \n0:04:15 How to Take This Course \n0:05:50 The Essentials\n0:06:53 Getting Started with Java \n0:09:23 Classes\n0:13:34 Coupling\n0:15:34 Interfaces\n0:21:17 Encapsulation\n0:26:25 Abstraction\n0:30:33 Inheritance\n0:32:55 Polymorphism\n0:36:42 UML\n0:40:52 Memento Pattern\n0:42:43 Solution\n0:48:31 Implementation\n0:54:22 State Pattern\n0:59:46 Solution\n1:02:59 Implementation\n1:09:31 Abusing the Design Patterns \n1:11:18 Abusing the State Pattern \n\n#coding #designpatterns', 'https://i.ytimg.com/vi/NU_1StN5Tkk/default.jpg', 'https://www.youtube.com/watch?v=NU_1StN5Tkk', NULL),
('nYIjoks316Y', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'Machine Learning frameworks for the gen AI era', 'Generative AI has captured everyone‚Äôs imagination. Come explore Google\'s best-in-class tools and frameworks for these use cases. We will cover JAX, a powerful framework for large-scale training and research that Google uses to build Gemini and Keras, a modeling framework for adapting gen AI OSS models that run on top of JAX, PyTorch, or TensorFlow.\n\nSpeakers: Carlos Araya, Grace Chen\n\nWatch more:\nCheck out all the AI videos at Google I/O 2024 ‚Üí https://goo.gle/io24-ai-yt\n\n\nSubscribe to Google Developers ‚Üí https://goo.gle/developers\n\n#GoogleIO  \n\nProducts Mentioned: TensorFlow, Keras\nEvent: Google I/O 2024', 'https://i.ytimg.com/vi/nYIjoks316Y/default.jpg', 'https://www.youtube.com/watch?v=nYIjoks316Y', NULL),
('nzzPMc1X_gM', 'UCWv7vMbMWH4-V0ZXdmDpPBA', 'Mind-Blowing AI:  This Tool Clones Voices Perfectly!', '#coding #chatgpt #ai', 'https://i.ytimg.com/vi/nzzPMc1X_gM/default.jpg', 'https://www.youtube.com/watch?v=nzzPMc1X_gM', NULL),
('N_l9038Fy8A', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'AI powered solutions: Reimagining health and science for society', 'AI has the potential to tackle the world‚Äôs biggest challenges - including health, medicine, climate, and education. Learn about the ways AI is helping researchers and scientists find new paths forward.\n\nTo watch and learn more, check out https://yt.be/dialogues\n\nSpeakers: Kay Firth-Butterfield, CEO Good Tech Advisory\nLloyd Minor, MD, Dean of the School of Medicine, Stanford University\nJames Manyika, SVP, Research, Technology & Society, Google\n\nWatch more:\nCheck out all the AI videos at Google I/O 2024 ‚Üí https://goo.gle/io24-ai-yt\n\n\nSubscribe to Google Developers ‚Üí https://goo.gle/developers\n\n#GoogleIO  \n\nEvent: Google I/O 2024', 'https://i.ytimg.com/vi/N_l9038Fy8A/default.jpg', 'https://www.youtube.com/watch?v=N_l9038Fy8A', NULL),
('oC33JZVy9bo', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'How to win a DeLorean', 'Join the Gemini API Developer Competition for a chance at cash prizes, cool swag, and a shot at winning an electric-powered DeLorean. To learn more, check out the Gemini API Developer Competition video to learn about the competition and guidelines.\n\nJoin the competition ‚Üí https://goo.gle/gemini-competition \n\nSubscribe to Google for Developers for more Gemini API content ‚Üí https://goo.gle/developers \n\n#Gemini #competition #BuildwithGemini', 'https://i.ytimg.com/vi/oC33JZVy9bo/default.jpg', 'https://www.youtube.com/watch?v=oC33JZVy9bo', NULL),
('OeEHJgzqS1k', 'UCWv7vMbMWH4-V0ZXdmDpPBA', 'From 0 to Back-End Developer in 12 Months: The Complete Roadmap', 'The essential skills and latest technologies to become a back-end developer in 2024. We\'ll cover each skill and the time needed to learn it.\n\nDownload the FREE roadmap PDF here: https://mosh.link/backend-roadmap\n\n‚úã Stay connected\n\n- Complete courses: https://codewithmosh.com\n- Twitter: https://twitter.com/moshhamedani\n- Facebook: https://www.facebook.com/programmingwithmosh/\n- Instagram: https://www.instagram.com/codewithmosh.official/\n- LinkedIn: https://www.linkedin.com/school/codewithmosh/\n\nüîó Other roadmaps\n\nhttps://youtu.be/Tef1e9FiSR0?si=QpVnZ_o9-DAXzT71\nhttps://youtu.be/yye7rSsiV6k?si=4ZIpjrqeU0fJk7os\n\nüìö Tutorials \n\nhttps://youtu.be/_uQrJ0TkZlc?si=QA5qvbvk60uP-7Gu\nhttps://youtu.be/eIrMbAQSU34?si=PmdmS1vo9Gp4yRxR\nhttps://youtu.be/8JJ101D3knE?si=OGTuS35LQqSunuhh\nhttps://youtu.be/BBpAmxU_NQo?si=dm-ZCPxVBYWS1Qhn\nhttps://youtu.be/NU_1StN5Tkk?si=gsMONPdgxouQOolu\nhttps://youtu.be/7S_tz1z_5bA?si=wUNE0zrN_6uWrO7d\nhttps://youtu.be/rHux0gMZ3Eg?si=w1h0R4U8freF5xPT\n\n\nüìñ Chapters\n\n00:00 - Introduction\n00:08 - Programming languages \n02:48 - Version control (Git)\n03:16 - Data structures & algorithms \n04:03 - Design patterns \n05:10 - Databases\n07:00 - Web frameworks\n08:02 - Additional skills \n\n#programming #webdevelopment #backend #coding', 'https://i.ytimg.com/vi/OeEHJgzqS1k/default.jpg', 'https://www.youtube.com/watch?v=OeEHJgzqS1k', NULL),
('oQRm98z8pWE', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'Ah bugs... the gift that keeps on giving. üôÉ', 'At this rate, our bug tracker is going to need its own version control. \n\nSubscribe to Google for Developers ‚Üí https://goo.gle/developers', 'https://i.ytimg.com/vi/oQRm98z8pWE/default.jpg', 'https://www.youtube.com/watch?v=oQRm98z8pWE', NULL),
('oX7dEZfBUvg', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'Semantic Retriever and Q&A Model now available as Developer API', 'Do you ever encounter AI hallucinations in your model? You‚Äôre not alone. That\'s why we created the Google Generative Language API Semantic Retriever and Attributed Question Answering model. Learn how these work together to help combat one of the biggest problems developers face when working with large language models.\n\nResources:\nGenerative AI Documentation site ‚Üí https://goo.gle/443gsoI   \nGetting started colab ‚Üí https://goo.gle/447gSdP \n\nSubscribe to Google for Developers ‚Üí https://goo.gle/developers\n\n#AI #GoogleAI \n\nSpeaker: Cher Hu\nProducts Mentioned: Google Generative AI Semantic Retriever API', 'https://i.ytimg.com/vi/oX7dEZfBUvg/default.jpg', 'https://www.youtube.com/watch?v=oX7dEZfBUvg', NULL),
('p-h1LpM1xm4', 'UCWv7vMbMWH4-V0ZXdmDpPBA', '5 Mistakes That Are Killing Your Coding Progress', 'Avoid these 5 progress-killing mistakes! Learn the RIGHT way to break into tech and finally get that high-paying position.\n\n‚úã Stay connected\n\n- Twitter: https://twitter.com/moshhamedani\n- Facebook: https://www.facebook.com/programmingwithmosh/\n- Instagram: https://www.instagram.com/codewithmosh.official/\n- LinkedIn: https://www.linkedin.com/school/codewithmosh/\n\n#coding #programming #softwaredevelopment', 'https://i.ytimg.com/vi/p-h1LpM1xm4/default.jpg', 'https://www.youtube.com/watch?v=p-h1LpM1xm4', NULL),
('p0Xug7cg36Q', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'Everything you need to know about Google Pay & Wallet', 'Explore the latest updates to Google Pay and Wallet. Learn about new partnerships that aim to reduce fraud and expand payment options, as well as developer features that make checkout conversions and testing more efficient. Plus, discover how Google Wallet is expanding its capabilities in the world of payments and digital valuables.\n\nInformation\nGoogle Wallet ‚Üí g.co/wallet/ytkb3s \nGoogle Pay ‚Üí g.co/pay/grg2ry \nWhere you can use Google Wallet ‚Üí g.co/wallet/awbjaq \n\nDocumentation\nGoogle Pay API documentation ‚Üí g.co/pay/hrr5cr \nGoogle Wallet API documentation ‚Üí g.co/wallet/kxvp8s \nGoogle Wallet developer newsletter sign-up ‚Üí g.co/wallet/tfgdpa \n\nTools\nGoogle Pay & Wallet Console ‚Üí g.co/wallet/2t65j9 \nGoogle Wallet pass builder ‚Üí g.co/wallet/u4n532 \nGoogle Pay API test suite ‚Üí g.co/pay/c6e2pg \nGoogle Wallet Flutter Plugin ‚Üí goo.gle/io-wallet-flutter\nGoogle Wallet API Client Libraries ‚Üí g.co/pay/mkza6g \nGoogle Pay Jetpack Compose Button ‚Üí goo.gle/pay-4w3CZ \nGoogle Pay Button web components ‚Üí goo.gle/pay-Bi2ta\nGoogle Wallet Auto-Linked Passes ‚Üí g.co/io/wallet-ALP\nGoogle Wallet Mobile Push Notifications ‚Üí g.co/io/wallet-MPN\nGoogle Wallet Gmail Integration ‚Üí g.co/io/wallet-gmail\nGoogle Wallet Generic Private Passes ‚Üí g.co/io/wallet-gpp\nGoogle Wallet Client Libraries ‚Üí g.co/io/wallet-libs\nGoogle Wallet Framework Integrations ‚Üí g.co/io/wallet-fmwk\nGlobal Gamers Challenge Winners ‚Üí goo.gle/io-wallet-ggs\nGoogle Wallet available in India ‚Üí g.co/io/wallet-india\nGoogle Wallet Identity Signup form ‚Üí g.co/io/wallet-id\nGoogle Wallet Metrics and Analytics ‚Üí g.co/io/wallet-console\n\nSpeakers: Kevin Miller, Edson Yanaga, Robert Dunnette\n\nWatch more:\nCheck out all the Mobile videos at Google I/O 2024 ‚Üí https://goo.gle/io24-mobile-yt\nCheck out all the Web videos at Google I/O 2024 ‚Üí https://goo.gle/io24-we