('P39vzzVUEN8', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'Kaggle is your home for trustworthy AI resources', 'ML is developing so rapidly, it\'s hard to know where to start for a new project. Kaggle\'s your solution. Kaggle is an online community with over 16 million members committed to sharing, stress testing, and staying up-to-date on the latest ML techniques and technologies. Learn how to leverage their vast library of resources (models, datasets & code), gain powerful insights from real-world competitions, and build faster with Kaggle\'s powerful web-based notebook environment with free GPUs and TPUs.\n\nKaggle API ‚Üí https://goo.gle/github-kaggle-api\nKaggle Hub ‚Üí https://goo.gle/github-kagglehub\nKaggle official site ‚Üí https://goo.gle/kaggle\n\nSpeakers: Nate Keating\n\nWatch more:\nCheck out all the AI videos at Google I/O 2024 ‚Üí https://goo.gle/io24-ai-yt\n\n\nSubscribe to Google Developers ‚Üí https://goo.gle/developers\n\n#GoogleIO  \n\nEvent: Google I/O 2024', 'https://i.ytimg.com/vi/P39vzzVUEN8/default.jpg', 'https://www.youtube.com/watch?v=P39vzzVUEN8', NULL),
('pEbIhUySqbk', 'UCWv7vMbMWH4-V0ZXdmDpPBA', 'React vs Angular vs Vue: What to Learn to Get a Front-end Job', 'What is the best JavaScript framework/library that everybody is learning these days? React, Angular or Vue? Watch this video to find out. \nHere are my other YouTube tutorials: \nLearn React: https://youtu.be/Ke90Tje7VS0\nJavaScript for React Developers: https://youtu.be/NCwa_xi0Uuc\nJavaScript for Beginners: https://youtu.be/W6NZfCO5SIk\nLearn Angular: https://youtu.be/k5E2AVpwsko\n\nüî•Get my Complete React Course with a big discount (limited to the first 200 students): \nhttps://programmingwithmosh.com/courses/react\n\nüëçSubscribe for more videos like this: https://goo.gl/6PYaGF\n\nThese days we have plenty of JavaScript frameworks and libraries for front end development. React, Angular and Vue are the top three that are used in most organizations around the world. If you\'re wondering whether you should learn #React, #Angular or #Vue for web development in 2019, this video can help. We\'ll look at each of these frameworks, their history, learning curve, and job market and then I\'ll tell you what framework to learn if you\'re looking for a front-end development job in 2019. \n\nStay in Touch:\nhttps://www.facebook.com/programmingwithmosh/\nhttps://twitter.com/moshhamedani\nhttp://programmingwithmosh.com', 'https://i.ytimg.com/vi/pEbIhUySqbk/default.jpg', 'https://www.youtube.com/watch?v=pEbIhUySqbk', NULL),
