('rTx5nw3AgnY', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'Quantum computing: Facts, fiction and the future', 'Dialogues on Technology and Society\n\nQuantum computing is a hot field right now‚Äîso hot that it‚Äôs hard to discern what‚Äôs real and what‚Äôs exaggerated. What‚Äôs feasible for quantum computers, and what‚Äôs not? The Google Quantum AI team will take you on a journey to the cutting edge and help you understand the current state of the art, separate fact from fiction, and prepare for what‚Äôs on the horizon.\n\nTo watch and learn more, check out https://yt.be/dialogues\n\nSpeakers: Charina Chou, Director and COO, Quantum AI, Google\nErik Lucero, Lead Quantum Engineering, Google\n\nWatch more:\nCheck out all the AI videos at Google I/O 2024 ‚Üí https://goo.gle/io24-ai-yt\n\n\nSubscribe to Google Developers ‚Üí https://goo.gle/developers\n\n#GoogleIO  \n\nEvent: Google I/O 2024', 'https://i.ytimg.com/vi/rTx5nw3AgnY/default.jpg', 'https://www.youtube.com/watch?v=rTx5nw3AgnY', NULL),
