('TV7qCk1dBWA', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'Large language models with Keras', 'The latest Keras 3 machine learning framework lets you write and run your code in JAX, Pytorch, or Tensorflow. Learn about Gemma, the large language model family of open models from Google. We will teach you basic and advanced LLM workflows, including chat generation, LoRA fine-tuning, model parallelism to train on large-scale infrastructure, style alignment, model surgery, and more.\n\nGet started with Gemma ‚Üí https://goo.gle/4daZbhC\n\nSpeakers: Martin Gorner, Gabriel Rasskin, Samaneh Saadat\n\nWatch more:\nCheck out all the AI videos at Google I/O 2024 ‚Üí https://goo.gle/io24-ai-yt\n\nSubscribe to Google Developers ‚Üí https://goo.gle/developers\n\n#GoogleIO  \n\nEvent: Google I/O 2024', 'https://i.ytimg.com/vi/TV7qCk1dBWA/default.jpg', 'https://www.youtube.com/watch?v=TV7qCk1dBWA', NULL),
('UGq8_Sivt4k', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'How to moderate text with Google AI', 'In this tutorial, we delve into the power of Google AI to streamline content moderation and even offer rewriting suggestions for authors. Join blondiebytes as we explore the capabilities of Google\'s Gemini model, leveraging Python to build an application that not only identifies potentially harmful content but also assists authors in crafting more appropriate text.\n\nChapters: \n0:00 - Intro \n0:57  - Getting your authentication credentials from Google AI Studio \n1:23 - Setting up your development environment \n2:04 - Writing the python code \n4:02 - Practice creating prompts in Google AI Studio \n4:32 - Understanding safety risks when using LLMs\n5:50 - Text-to-moderate app demo \n\nResources: \nGet started by creating your API key at Google\'s AI Studio ‚Üí  https://goo.gle/3QwNgkD \n\nLearn about the importance of safety settings and content moderation in AI language models ‚Üí https://goo.gle/4adrppp \n\nInsights from Google\'s Deep Mind blog ‚Üí https://goo.gle/3UypNR3 \n\nExplore the safety attributes and settings documentation to ensure responsible AI usage ‚Üí https://goo.gle/3wx6M9G \n\n\nSubscribe to Google for Developers ‚Üí https://goo.gle/developers  \n\n\nNote: the API key used in the video is not active and only used for demo.', 'https://i.ytimg.com/vi/UGq8_Sivt4k/default.jpg', 'https://www.youtube.com/watch?v=UGq8_Sivt4k', NULL),
('uJLwnsLn0_Q', 'UCWv7vMbMWH4-V0ZXdmDpPBA', 'Bubble Sort in Plain English', 'Learn to implement the Bubble Sort algorithm and ace your coding interview.\nüëçSubscribe for more data structure and algorithm tutorials like this: https://goo.gl/6PYaGF\nüöÄGet the full data structures and algorithms course: https://bit.ly/2YfL3zr\n\nCONNECT WITH ME\n\nMy Courses: http://codewithmosh.com\nMy Blog: http://programmingwithmosh.com\nMy Facebook: https://www.facebook.com/programmingwithmosh\nMy Twitter: https://twitter.com/moshhamedani\n\nData Structures and Algorithms is an essential topic taught to computer science and software engineering students to help them learn logical thinking and problem solving. That\'s why a lot of companies these days ask data structure and algorithm questions in their interviews. Sorting algorithms are particularly important. Even though you never have to implement a sorting algorithm in real life, studying and understanding these algorithms help you become better solving larger, more complex problems.', 'https://i.ytimg.com/vi/uJLwnsLn0_Q/default.jpg', 'https://www.youtube.com/watch?v=uJLwnsLn0_Q', NULL),
('ulY5luY2t30', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'The limitless possibilities of on-device ML: From accessible toys to grading grapes', 'Paul and Lance imagine the future of what on device machine learning can do to make the world more accessible, accurate, and interesting\n\nChapters: \n0:00 - Intro \n0:42 - Toys\n2:17 - Image Classification\n3:43 - Audio Classification\n4:50 - Language Skills\n5:38 - Sign Language\n7:07 - How recognition works\n7:38 - License Plates\n8:38 - Recognizing emotions\n9:35 - Learn more\n\nResources:\nLearn more about Project Gameface ‚Üí https://goo.gle/3wCCaDR \nWatch episode 1 ‚Üí https://goo.gle/3WGc5yd \nWatch episode 2 ‚Üí https://goo.gle/4b77mtX \nWatch episode 3 ‚Üí https://goo.gle/3UXswVA \n\nCheck out all of our videos about Project Gameface ‚Üí [LINK]\nSubscribe to the TensorFlow channel ‚Üí https://goo.gle/TensorFlow \n\n#MediaPipe #Accessibility #Gaming\n\nSpeaker: Paul Ruiz', 'https://i.ytimg.com/vi/ulY5luY2t30/default.jpg', 'https://www.youtube.com/watch?v=ulY5luY2t30', NULL),
