('w6D1DKrumKA', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'Introducing the Google Developer Program, Building with AI on Android updates, and more dev news!', 'TL;DR 393  | The Google Developer News Show\n\n0:00 - Intro \n0:17 - Top 3 updates for building with AI on Android at Google I/O ‚Äò24 ‚Üí https://goo.gle/4bRC7Dn \n0:47 - Introducing the Google Developer Program: Unlock New Opportunities ‚Üí https://goo.gle/4ceNuFc  \n1:17 - Using generative AI to investigate medical imagery models and datasets ‚Üí https://goo.gle/3xeYm7l \n\nHere to bring you the latest developer news from across Google is Anuj Duggal. Tune in every week for a new episode, and let us know what you think of the latest announcements in the comments below.\n\nFollow Google for Developers on Instagram ‚Üí https://goo.gle/googledevs\n\nWatch more #DevShow ‚Üí https://goo.gle/GDevShow\nSubscribe to Google for Developers ‚Üí https://goo.gle/developers\n\n#Google #Developers\n\n\nSpeaker: Anuj Duggal;', 'https://i.ytimg.com/vi/w6D1DKrumKA/default.jpg', 'https://www.youtube.com/watch?v=w6D1DKrumKA', NULL),
('wGd0wO5Ld0c', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'Can a backend engineer learn Flutter with AI?', 'Have you ever wanted to learn a new framework without reading through endless documentation? With power of AI, we can! ‚ú®\n\nJoin me (@blondiebytes ) as we build our first Flutter web app, all while being seamlessly guided by AI. Together, we\'ll elevate a basic template app into an engaging dice roller while querying AI with questions that come up along the way.\n\nLet\'s explore the possibilities with Google\'s IDX and transform learning into an exciting adventure! \n\nSubscribe to Google for Developers ‚Üí https://goo.gle/developers  \n\n#developers', 'https://i.ytimg.com/vi/wGd0wO5Ld0c/default.jpg', 'https://www.youtube.com/watch?v=wGd0wO5Ld0c', NULL),
('WJqdeSYuUkI', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'Gemma models: Unveiling the latest advancements', 'Gemma is Google‚Äôs family of lightweight, state-of-the art open models built from the same research and technology used to create the Gemini models. Join this session to learn how to get started. We‚Äôll cover the types of models available and how to customize them to excel at new tasks. You‚Äôll learn how to perform training and inference with Keras 3.0 in just a few lines of code, how to deploy models to Android with MediaPipe, and how to serve them on Google Cloud.\n\nGet started with Gemma ‚Üí https://goo.gle/4daZbhC\n\nSpeakers: Luiz GUStavo Martins, Kat Black\n\nWatch more:\nCheck out all the AI videos at Google I/O 2024 ‚Üí https://goo.gle/io24-ai-yt\n\n\nSubscribe to Google Developers ‚Üí https://goo.gle/developers\n\n#GoogleIO  \n\nProducts Mentioned: Gemma\nEvent: Google I/O 2024', 'https://i.ytimg.com/vi/WJqdeSYuUkI/default.jpg', 'https://www.youtube.com/watch?v=WJqdeSYuUkI', NULL),
('XBoZPCgdnm8', 'UCWv7vMbMWH4-V0ZXdmDpPBA', 'New Course: Data Structures and Algorithms Course', 'Get the course with a discount: \nPart 1: http://bit.ly/31PqOY1\nPart 2: http://bit.ly/2k0LlIS', 'https://i.ytimg.com/vi/XBoZPCgdnm8/default.jpg', 'https://www.youtube.com/watch?v=XBoZPCgdnm8', NULL),
('XKkoVpupYdw', 'UCWv7vMbMWH4-V0ZXdmDpPBA', 'Is Devin AI the End (or Future) of Coding?!', 'Is this new AI really going to steal your coding job? Devin AI is causing a stir... Let\'s be real, the hype is crazy, but is it justified? I\'m breaking down Devin AI\'s potential, the reality, and what YOU need to do to stay ahead.\n\nRelated video: https://youtu.be/HXH4yu227EQ?si=nSJluCvym-3CArG5\n\n#ai #coding #programming \n\n‚úã Stay connected:\n- Twitter: https://twitter.com/moshhamedani\n- Facebook: https://www.facebook.com/programmingwithmosh/\n- Instagram: https://www.instagram.com/codewithmosh.official/\n- LinkedIn: https://www.linkedin.com/school/codewithmosh/\n\nüìñ What\'s covered\n00:00 Devin AI and the Coding Job Panic \n00:37 Will Devin Succeed?\n00:56 Can Devin Handle Real-world Software?\n01:38 Debunking NVIDIA CEO\'s Nonsense about Programming\n02:42 Will Software Jobs Disappear In the Future?\n03:48 How to Stay Relevant as a Software Engineer\n04:17 How AI Changes Your Job\n05:26 Can AI Replace Multiple Engineers with One?\n06:39 Why Software Engineers are Not Going Away \n06:54 Love Coding? Here\'s Why You Shouldn\'t Quit\n07:40 What to Do to Build Your Software Career Along with AI', 'https://i.ytimg.com/vi/XKkoVpupYdw/default.jpg', 'https://www.youtube.com/watch?v=XKkoVpupYdw', NULL),
('xKmEOXZsU_0', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'Google I/O 2024 Developer keynote in 5 minutes', 'Catch up on everything announced at Google I/O 2024. Hear about Gemini across our development tools, new models, and new ways to build, ship, and test across all the platforms your users expect!\n\nResources: \nTry Gemini in Vertex AI ‚Üí https://goo.gle/3Vttolh \n\nSubscribe to Google for Developers ‚Üí https://goo.gle/developers \n\n#GoogleIO\n\nProducts Mentioned: Gemini\nEvent: Google I/O 2024', 'https://i.ytimg.com/vi/xKmEOXZsU_0/default.jpg', 'https://www.youtube.com/watch?v=xKmEOXZsU_0', NULL),
('XQ_Hvu-s7JY', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'The latest in Material Design', 'Discover the latest from Material Design, including color and typography updates that empower developers to create personalized, accessible products, and a more comprehensive Compose offering. Then, learn how it all comes together with a sneak peek at Google Maps, and how they ship features to production using Material for Compose.\n\nSpeakers: Mike Talvensaari, James Williams, Sagie Pudinsky, Noa Dolberg\n\nWatch more:\nCheck out all the Mobile videos at Google I/O 2024 ‚Üí https://goo.gle/io24-mobile-yt\nCheck out all the Design sessions from Google I/O ‚Üí https://goo.gle/io24-design-yt\n\nSubscribe to Google Developers ‚Üí https://goo.gle/developers\n\n#GoogleIO  \n\n\nEvent: Google I/O 2024', 'https://i.ytimg.com/vi/XQ_Hvu-s7JY/default.jpg', 'https://www.youtube.com/watch?v=XQ_Hvu-s7JY', NULL),
('XSghQlA-Gug', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'It doesn‚Äôt stand for Luscious Lemon Meringue? üçã', 'What does LLM stand for? Let us know your best (wrong) guess!\n\nSubscribe to Google for Developers ‚Üí https://goo.gle/developers', 'https://i.ytimg.com/vi/XSghQlA-Gug/default.jpg', 'https://www.youtube.com/watch?v=XSghQlA-Gug', NULL);
INSERT INTO `youtube_channel_videos` (`video_id`, `channel_id`, `title`, `description`, `thumbnail_url`, `video_link`, `published_at`) VALUES
('XyayvDGKSfM', 'UCWv7vMbMWH4-V0ZXdmDpPBA', 'This Robot Has a ChatGPT Brain!', 'Could a robot steal YOUR job? This humanoid powered by ChatGPT tech can understand your instructions and carry out tasks. Let\'s talk about the future of work...and whether we should be worried.\n\n#chatgpt #openai #ai #robot\n\nüí° Related videos:\nhttps://youtu.be/XKkoVpupYdw?si=w6tFGrNn0wO9Qyeo\nhttps://youtu.be/HXH4yu227EQ?si=gYjEJcoUICdUAKbd\nhttps://youtu.be/ZzaPdXTrSb8?si=e5zjhIy6KYBdWXg8\nhttps://youtu.be/kqtD5dpn9C8?si=6Fx0k0zaHB-UCg5Y\n\n\n‚úã Stay connected:\n- Twitter: https://twitter.com/moshhamedani\n- Facebook: https://www.facebook.com/programmingwithmosh/\n- Instagram: https://www.instagram.com/codewithmosh.official/\n- LinkedIn: https://www.linkedin.com/school/codewithmosh/\n\n\nüìñ What\'s covered\n00:00 Introduction\n00:21 Meet Figure 01\n01:16 Why Figure 01 is a Game-changer\n02:35 Programming Languages Used in AI & Robotics\n03:01 Is Your Job at Risk?\n03:51 Will AI Replace Software Engineers?\n04:17 Bold Claims: Is the Job Market Doomed?\n05:16 Could a Robots Replace YOU?\n06:13 Lessons from the Past Robot Experiments\n06:52 My Honest Take: Hype or Reality?', 'https://i.ytimg.com/vi/XyayvDGKSfM/default.jpg', 'https://www.youtube.com/watch?v=XyayvDGKSfM', NULL),
('y28-ZuzLGBo', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'Building trust with community-informed AI evaluation', 'Building trust is key to generative AI adoption and creating better user experiences. Developers are increasingly expected to engage with users ‚Äì including people from historically marginalized communities ‚Äì to cultivate trust and ensure responsible development of generative AI tools. Learn actionable steps to integrate diverse community feedback on responsible AI principles into AI evaluation, helping you co-build AI with external stakeholders.\n\nSpeakers: Qazi Mamunur Rashid, Jamila Smith-Loud\n\nWatch more:\nCheck out all the Mobile videos at Google I/O 2024 ‚Üí https://goo.gle/io24-mobile-yt\nCheck out all the AI videos at Google I/O 2024 ‚Üí https://goo.gle/io24-web-yt\n\nSubscribe to Google Developers ‚Üí https://goo.gle/developers\n\n#GoogleIO  \n\nProducts Mentioned: Responsible AI\nEvent: Google I/O 2024', 'https://i.ytimg.com/vi/y28-ZuzLGBo/default.jpg', 'https://www.youtube.com/watch?v=y28-ZuzLGBo', NULL),
('YO8QRM2K89E', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'Collaborative model development with Keras, Kaggle, and Colab', 'In this workshop, AI/ML developers will learn how to use Keras to fine-tune Gemma, a new open large language model from Google, for their generative AI applications. We\'ll highlight how new integrations with Kaggle Models and Colab make it easy to get started thanks to community-developed resources and support. We\'ll also explore how to contribute back to the community by using Keras to push a fine-tuned variant of the model back to Kaggle Models using new publishing capabilities.\n\nThis workshop requires a laptop, and Kaggle and Google accounts to sign into Colab.\n\nKerasNLP ‚Üí https://goo.gle/3nY4HPu\nKeras Models on Kaggle ‚Üí https://goo.gle/3xSeZpu\nColab ‚Üí https://goo.gle/ai-kaggle-keras-gemma\n\nSpeakers: Meg Risdal, Neel Kovelamudi\n\nWatch more:\nCheck out all the AI videos at Google I/O 2024 ‚Üí https://goo.gle/io24-ai-yt\n\nSubscribe to Google Developers ‚Üí https://goo.gle/developers\n\n#GoogleIO  \n\nProducts Mentioned: Gemma, Colab, Keras\nEvent: Google I/O 2024', 'https://i.ytimg.com/vi/YO8QRM2K89E/default.jpg', 'https://www.youtube.com/watch?v=YO8QRM2K89E', NULL),
('yye7rSsiV6k', 'UCWv7vMbMWH4-V0ZXdmDpPBA', 'From 0 to Mobile App Developer in 12 Months: The Complete Roadmap', 'The essential skills and latest technologies to become a mobile developer in 2024. We\'ll cover each skill and the time needed to learn it.\n\nDownload the FREE roadmap PDF here: https://mosh.link/mobile-roadmap\n\n‚úã Stay connected\n\n- Complete courses: https://codewithmosh.com\n- Twitter: https://twitter.com/moshhamedani\n- Facebook: https://www.facebook.com/programmingwithmosh/\n- Instagram: https://www.instagram.com/codewithmosh.official/\n- LinkedIn: https://www.linkedin.com/school/codewithmosh/\n\nüîó Other roadmaps\n\nhttps://youtu.be/Tef1e9FiSR0?si=QpVnZ_o9-DAXzT71\nhttps://youtu.be/OeEHJgzqS1k?si=qd0ZIqAzUpZQn6BX\n\nüìö Tutorials \n\nhttps://youtu.be/W6NZfCO5SIk?si=yS0lQXyy3qwQF3DA\nhttps://youtu.be/8JJ101D3knE?si=OGTuS35LQqSunuhh\nhttps://youtu.be/BBpAmxU_NQo?si=dm-ZCPxVBYWS1Qhn\nhttps://youtu.be/NU_1StN5Tkk?si=gsMONPdgxouQOolu\nhttps://youtu.be/SqcY0GlETPk?si=O93IXejTVuh_5cbY\nhttps://youtu.be/0-S5a0eXPoc?si=yP7qia07NN2FMeS2\n\n\nüìñ Chapters\n\n00:00 - Introduction\n00:08 - Native vs Cross-platform Development\n04:08 - Languages\n04:57 - Version control (Git)\n05:25 - Data structures & algorithms \n06:12 - Design patterns \n07:14 - Mobile frameworks\n\n#appdevelopment #coding #programming', 'https://i.ytimg.com/vi/yye7rSsiV6k/default.jpg', 'https://www.youtube.com/watch?v=yye7rSsiV6k', NULL),
('z3-XFI_nXNM', 'UCWv7vMbMWH4-V0ZXdmDpPBA', 'Python Practice - Interview Question - Fizz Buzz | Mosh', 'Fizz buzz is a popular Python interview question. Watch this video and practice Python.\n\nüî•Subscribe for more Python tutorials like this: https://www.youtube.com/channel/UCWv7vMbMWH4-V0ZXdmDpPBA?sub_confirmation=1\n\nüî•Python for Beginners Tutorial: https://youtu.be/yE9v9rt6ziw\n\nPython Exercises for Beginners: \nhttps://programmingwithmosh.com/python/python-exercises-and-questions-for-beginners/\n\nPython Cheat Sheet: \nhttps://programmingwithmosh.com/python/python-3-cheat-sheet/\n\n\nWant to learn more from me? Check out my blog and courses: \n\nhttp://programmingwithmosh.com \nhttps://www.facebook.com/programmingwithmosh/\nhttps://twitter.com/moshhamedani', 'https://i.ytimg.com/vi/z3-XFI_nXNM/default.jpg', 'https://www.youtube.com/watch?v=z3-XFI_nXNM', NULL),
('zeFxny7KSlY', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'Visual Blocks ML: Create AI demos faster using custom nodes for your favorite APIs', 'Visual Blocks ML is a powerful low-code solution that provides over 70 nodes you can arrange or connect together to take any AI powered idea to working prototype faster. Learn how to make your own custom nodes that work seamlessly with existing ones, opening up creative workflows that can be shared publicly or used with your internal products and services.\n\nBring a laptop to try the code. A code editor is necessary and have a web server like Apache installed with CORS enabled.\n\nVisual Blocks ‚Üí https://goo.gle/VisualBlocksML\n\nSpeaker: Jason Mayes\n\nWatch more:\nCheck out all the AI videos at Google I/O 2024 ‚Üí https://goo.gle/io24-ai-yt\n\nSubscribe to Google Developers ‚Üí https://goo.gle/developers\n\n#GoogleIO  \n\nEvent: Google I/O 2024', 'https://i.ytimg.com/vi/zeFxny7KSlY/default.jpg', 'https://www.youtube.com/watch?v=zeFxny7KSlY', NULL),
('ZhExnit0UdM', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'Developing for Indic languages | Gemma and Navarasa (Extended Edition)', 'While many early large language models were predominantly trained on English language data, the field is rapidly evolving. Newer models are increasingly being trained on multilingual datasets, and there\'s a growing focus on developing models specifically for the world‚Äôs languages. However, challenges remain in ensuring equitable representation and performance across diverse languages, particularly those with less available data and computational resources.\n\nGemma, Google\'s family of open models, is designed to address these challenges by enabling the development of projects in non-Germanic languages. Its tokenizer and large token vocabulary make it particularly well-suited for handling diverse languages. Watch how developers in India used Gemma to create Navarasa ‚Äî a fine-tuned Gemma model for Indic languages.\n\nSubscribe to Google for Developers ‚Üí https://goo.gle/developers\n\n#GoogleIO #GoogleIO2024', 'https://i.ytimg.com/vi/ZhExnit0UdM/default.jpg', 'https://www.youtube.com/watch?v=ZhExnit0UdM', NULL),
