('zuKbR4Q428o', 'UCWv7vMbMWH4-V0ZXdmDpPBA', 'JavaScript Unit Testing Tutorial for Beginners', 'Write bulletproof JavaScript code with unit testing! üí™  This beginner-friendly tutorial will teach you the essentials for cleaner, more reliable apps.\n\nKey benefits of unit testing:\n- Catch bugs early in development \n- Boost confidence in your code \n- Write better, more maintainable JavaScript \n\nüöÄ Want more? \n- Check out my full JavaScript Unit Testing Course: https://bit.ly/javascript-unit-testing\n- Subscribe for more videos like this: https://goo.gl/6PYaGF\n\n‚úã Stay connected for updates and exclusive content! Follow me on:\n- Twitter: https://twitter.com/moshhamedani\n- Facebook: https://www.facebook.com/programmingwithmosh/\n- Instagram: https://www.instagram.com/codewithmosh.official/\n- LinkedIn: https://www.linkedin.com/school/codewithmosh/\n\nüìñ TABLE OF CONTENT \n0:00:00 Course Intro\n0:01:21 Prerequisites\n0:02:01 Course Structure\n0:04:16 How to Take This Course\n0:05:14 Setting Up the Testing Environment \n0:05:46 Starter Project\n0:06:40 Introduction to Unit Testing\n0:08:19 What is Unit Testing?\n0:13:39 Types of Tests\n0:16:53 Choosing a Testing Framework \n0:18:31 Setting Up Vitest\n0:19:44 Writing Your First Test\n0:29:04 Exercise: Testing fizzBuzz \n0:35:00 Test-Driven Development \n0:42:10 Exercise: Testing Factorial \n\n#javascript #testing', 'https://i.ytimg.com/vi/zuKbR4Q428o/default.jpg', 'https://www.youtube.com/watch?v=zuKbR4Q428o', NULL),
('zUpf1ad4R_U', 'UC_x5XG1OV2P6uZZ5FSM9Ttw', 'Google I/O program details now live, New AI tools for Google for Developers, and more dev news!', 'TL;DR 389  | The Google Developer News Show\n\n0:00 - Intro \n0:16 - Google I/O program release lineup revealed! ‚Üí https://goo.gle/4dqVoNj \n0:45 - Google Summer of Code 2024 accepted contributors announced ‚Üí https://goo.gle/3JOmr7x \n1:16 - Introducing new AI tools for Google for Developers ‚Üí https://goo.gle/3UK5WzL \n\nHere to bring you the latest developer news from across Google is Khanh Nguyen. Tune in every week for a new episode, and let us know what you think of the latest announcements in the comments below.\n\nFollow Google for Developers on Instagram ‚Üí https://goo.gle/googledevs\n\nWatch more #DevShow ‚Üí https://goo.gle/GDevShow\nSubscribe to Google for Developers ‚Üí https://goo.gle/developers\n\n#Google #Developers\n\nSpeaker: Khanh Nguyen\nProducts Mentioned: Google AI', 'https://i.ytimg.com/vi/zUpf1ad4R_U/default.jpg', 'https://www.youtube.com/watch?v=zUpf1ad4R_U', NULL),
('ZVnjOPwW4ZA', 'UCWv7vMbMWH4-V0ZXdmDpPBA', 'Next js Tutorial for Beginners | Nextjs 13 (App Router) with TypeScript', 'Master Next.js 13 and build amazing full-stack apps! üöÄ This beginner-friendly tutorial covers the new App Router, TypeScript, and everything you need to get started.\n\nüöÄ Want to dive deeper?\n- Check out my complete Next.js series: https://bit.ly/nextjs-series\n- Subscribe for more videos like this: https://goo.gl/6PYaGF\n\nüí° Learn React\n- YouTube tutorial: https://youtu.be/SqcY0GlETPk?si=QHDzD9EaoXoPm1KM\n- Complete React course: https://bit.ly/3l0vWYR\n\n‚úã Stay connected:\n- Twitter: https://twitter.com/moshhamedani\n- Facebook: https://www.facebook.com/programmingwithmosh/\n- Instagram: https://www.instagram.com/codewithmosh.official/\n- LinkedIn: https://www.linkedin.com/school/codewithmosh/\n\nüìñ TABLE OF CONTENT\n0:00:00 Course Intro\n0:02:12 Prerequisites\n0:03:16 Next.js Fundamentals\n0:03:54 What is Next.js?\n0:06:34 Setting Up the Development Environment \n0:07:59 Creating Your First Next.js Project\n0:10:21 Project Structure\n0:13:10 Routing and Navigation\n0:18:25 Client and Server Components\n0:27:19 Data Fetching\n0:33:23 Caching\n0:35:48 Static and Dynamic Rendering\n0:39:56 Styling Next.js Applications\n0:40:16 Global Styles\n0:42:50 CSS Modules\n0:47:17 Tailwind CSS\n0:54:56 DaisyUI\n\n#nextjs #reactjs  #javascript #coding #webdevelopment', 'https://i.ytimg.com/vi/ZVnjOPwW4ZA/default.jpg', 'https://www.youtube.com/watch?v=ZVnjOPwW4ZA', NULL),
